// Imports ...
import React from 'react'
// Get reactDOM...
import reactDOM from 'react-dom'
// Get styled-components...
import styled from 'styled-components'
import { createGlobalStyle } from 'styled-components'

// Get modules/components ....
import T4TLogo from './T4TLogo'
import NavBar from './NavBar'
// Utilities...
import el from './utils/DOM/el'


// Cover backdrop
const coverOverlay = './assets/images/amurTiger01.jpg'
// Global styles....
const GlobalStyle = createGlobalStyle`
// Google fonts...
  @import url("https://fonts.googleapis.com/css?family=Covered+By+Your+Grace|Dancing+Script:400,700|Gabriela|Just+Another+Hand|Pacifico|Reem+Kufi|Sacramento|Telex&display=swap");
// Styles ...
  html {
    padding: 0;
    margin: 0;
    background: black;
  }

  body {
    padding: 0;
    margin: 0;
    background: black;
  }
`

const BigDiv = styled.div`
  position: relative;
  height: 729px;
  width: 100%;
  background: skyblue;
`

// The cover component....
const Cover = styled.img.attrs({
  src: coverOverlay,
  height: '100%',
  width: '100%'
})`
  z-index: -1;
`


// The app....
class App extends React.Component {
  render() {
    return (
      <React.Fragment>
        <GlobalStyle/>
        <NavBar/>
        <Cover/>
        <T4TLogo/>
        <BigDiv/>
      </React.Fragment>
    )
  }
}

// Application rendering....
reactDOM.render(
  <App/>, document.getElementById('root')
)
